INSERT INTO `training_plan` VALUES
(1,144,'2025-04-23','Endurance Ride','120 minutes','','Ride at a steady pace, keeping your heart rate between 60-70% of your max HR. Focus on maintaining a consistent effort.','./zwo/144_2025-04-23_Endurance_Ride.zwo',NULL),
(2,144,'2025-04-25','Sweet Spot Intervals','120 minutes','','Warm-up for 20 minutes, then perform 3x15 minutes at 85-95% of FTP with 5-minute rest intervals. Cool down for the remainder of the time.','./zwo/144_2025-04-25_Sweet_Spot_Intervals.zwo',NULL),
(3,144,'2025-04-28','Hill Repeats','120 minutes','','After a warm-up, perform 5x5 minute hill climbs at 90-100% of FTP with 8-minute easy spinning between intervals. Cool down for the remainder.','./zwo/144_2025-04-28_Hill_Repeats.zwo',NULL),
(4,144,'2025-04-30','Tempo Ride','120 minutes','','Maintain a tempo pace for the entirety of the ride. Aim to keep your heart rate between 75-85% of your max HR.','./zwo/144_2025-04-30_Tempo_Ride.zwo',NULL),
(5,144,'2025-05-02','VO2 Max Intervals','120 minutes','','After warming up, perform 6x3 minute efforts at 105-120% of FTP with 3-minute recovery spins. Cool down for the remainder.','./zwo/144_2025-05-02_VO2_Max_Intervals.zwo',NULL),
(6,144,'2025-05-05','Long Endurance Ride','120 minutes','','Focus on riding at a steady endurance pace. Keep your heart rate between 60-70% of your max HR.','./zwo/144_2025-05-05_Long_Endurance_Ride.zwo',NULL),
(7,144,'2025-05-07','Threshold Intervals','120 minutes','','Warm-up, then perform 4x10 minutes at FTP with 5-minute rest intervals. Cool down for the remainder.','./zwo/144_2025-05-07_Threshold_Intervals.zwo',NULL),
(8,144,'2025-05-09','Recovery Ride','120 minutes','','Keep this ride at an easy pace, allowing your body to recover. Keep your heart rate below 60% of max HR.','./zwo/144_2025-05-09_Recovery_Ride.zwo',NULL),
(9,144,'2025-05-12','Sweet Spot Intervals','120 minutes','','Warm-up for 20 minutes, then perform 3x20 minutes at 85-95% of FTP with 5-minute rest intervals. Cool down for the remainder of the time.','./zwo/144_2025-05-12_Sweet_Spot_Intervals.zwo',NULL),
(10,144,'2025-05-14','Tempo Ride','120 minutes','','Maintain a tempo pace for the entirety of the ride. Aim to keep your heart rate between 75-85% of your max HR.','./zwo/144_2025-05-14_Tempo_Ride.zwo',NULL),
(11,144,'2025-05-16','VO2 Max Intervals','120 minutes','','After warming up, perform 5x4 minute efforts at 105-120% of FTP with 3-minute recovery spins. Cool down for the remainder.','./zwo/144_2025-05-16_VO2_Max_Intervals.zwo',NULL),
(12,144,'2025-05-19','Long Endurance Ride','120 minutes','','Focus on riding at a steady endurance pace. Keep your heart rate between 60-70% of your max HR.','./zwo/144_2025-05-19_Long_Endurance_Ride.zwo',NULL),
(13,144,'2025-05-21','Threshold Intervals','120 minutes','','Warm-up, then perform 3x15 minutes at FTP with 5-minute rest intervals. Cool down for the remainder.','./zwo/144_2025-05-21_Threshold_Intervals.zwo',NULL),
